css:
@-moz-document domain('www.tumblr.com') {

.new_post_label {
  padding: 71px 1px 8px 0 !important;
  /*text-transform: lowercase;*/
  /*color: midnightblue !important;*/
}
#post_buttons .new_post_label:nth-of-type(1) {color: rgb(71,71,71)}
#post_buttons .new_post_label:nth-of-type(2) {color: rgb(216,95,66)}
#post_buttons .new_post_label:nth-of-type(3) {color: rgb(239,155,52)}
#post_buttons .new_post_label:nth-of-type(4) {color: rgb(86,188,135)}
#post_buttons .new_post_label:nth-of-type(5) {color: rgb(78,168,215)}
#post_buttons .new_post_label:nth-of-type(6) {color: rgb(170,125,194)}
#post_buttons .new_post_label:nth-of-type(7) {color: rgb(115,130,139)}

